import React from 'react';
import BookmarkMobile from '../../assets/bookmark-mobile.svg';

const BookmarkMobileComponent = () => (
  <div className="Bookmark-Component">
    <img src={BookmarkMobile} className="bookmark" alt="humanitarian" />
  </div>
);

export default BookmarkMobileComponent;
